import React from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

const App = () => {
  const sliderImages = [
    "https://www.instagram.com/nss_vce/p/C_Vg3koTDD6/",
    "https://via.placeholder.com/600x300?text=Slide+2",
    "https://via.placeholder.com/600x300?text=Slide+3",
  ];

  const sliderSettings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 3000,
  };

  return (
    <div>
      {/* Header Section */}
      <header style={{ display: "flex", alignItems: "center", padding: "10px" }}>
        <h1 style={{ flex: 1 }}>NSS Vasavi College of Engineering</h1>
        <img
          src="https://e7.pngegg.com/pngimages/676/129/png-clipart-mahatma-gandhi-college-university-of-kerala-government-of-india-university-college-of-engineering-kariavattom-national-service-scheme-others-blue-text.png"
          alt="Logo"
          style={{ height: "100px", width:"100px"}}
        />
      </header>

      {/* Navigation Bar */}
      <nav style={{ backgroundColor: "#80ff00", padding: "10px" }}>
        <ul
          style={{
            display: "flex",
            listStyleType: "none",
            margin: 0,
            padding: 0,
            justifyContent: "space-around",
          }}
        >
          <li>
            <a
              href="#home"
              style={{ color: "white", textDecoration: "none", fontSize: "18px" }}
            >
              Home
            </a>
          </li>
          <li>
            <a
              href="#about"
              style={{ color: "white", textDecoration: "none", fontSize: "18px" }}
            >
              About
            </a>
          </li>
          <li>
            <a
              href="#contact"
              style={{ color: "white", textDecoration: "none", fontSize: "18px" }}
            >
              Contact
            </a>
          </li>
          <li>
            <a
              href="#tfi"
              style={{ color: "white", textDecoration: "none", fontSize: "18px" }}
            >
              TFI
            </a>
          </li>
        </ul>
      </nav>

      {/* Image Slider */}
      <div style={{ margin: "20px" }}>
        <Slider {...sliderSettings}>
          {sliderImages.map((image, index) => (
            <div key={index}>
              <img
                src={image}
                alt={`Slide ${index + 1}`}
                style={{ width: "100%", borderRadius: "10px" }}
              />
            </div>
          ))}
        </Slider>
      </div>
    </div>
  );
};


export default App;
